import { getUsedMarket } from "../server/api";
import Items from "./Items";

function App() {
  return (
    <div>
      <div>{Items}</div>
      <div>
        <button>판다마켓</button>
        <a href="FreeBoard">자유게시판</a>
        <a href="Items">중고마켓</a>
        <button>로그인</button>
      </div>
      <div>
        <input />
        <button>상품 등록하기</button>
      </div>
    </div>
  );
}

export default App;
